export const columns = (vm: any) => {
  return [
    {
      title: '省',
      dataIndex: 'province_name'
    },
    {
      title: '市',
      dataIndex: 'city_name'
    },
    {
      title: '区',
      dataIndex: 'district_name'
    },
    {
      title: '门店名称',
      dataIndex: 'shop_name'
    }
  ]
}
